                    </ul>
                </nav>
                <section id="home">
                    <h1>Welcome to my site</h1>
                    <p>lorem ipsum</p>
                </section>
                <section id="about">
                    <h1>About</h1>
                    <p>lorem ipsum</p>
                </section>
                <section id="contact">
                    <h1>Contact</h1>
                    <p>lorem ipsum</p>
                </section>
            </div>
        );
    }

}

export default Header;
